import React from "react";
import ReactDOM from 'react-dom/client';
import Student from './Student';

const root = ReactDOM.createRoot(document.getElementById('root'));


root.render(    
<>  
<Student name='Ajay' age={22} IsStudent={true}/>
<Student name='Ravi' age={25} IsStudent={true}/>
<Student name='Deep' age={30} IsStudent={false}/>
<Student name='Akash' age={35} IsStudent={false}/>
<Student name="Midi"/>


</>

)












